import React from 'react';
import { Button, Form, Input } from 'antd';
import styled from 'styled-components';

const Wrapper = styled.div`
    width:100%;
    display: flex;
    align-items: center;
    justify-content: center;
`;

const LoginForm = () => {
    return (
        <Wrapper>
            <Form>
                <Input />
                <Input />
            </Form>
        </Wrapper>
    )
}

export default LoginForm;
